import classes from "./Footer.module.css";

const Footer = () => {
  return (
    <div className={classes.container}>
      <a href="https://www.linkedin.com/in/matteolaicreative/">LinkedIn</a>
      <a href="https://www.facebook.com/matteolai1989/">Facebook</a>
      <a href="https://www.instagram.com/matteolai89/">Instagram</a>
    </div>
  );
};

export default Footer;
